INSERT INTO `consults` (`consult_id`, `visit_id`, `date`, `doctor`, `notes`, `diagnosis`, `problems`, `urine_test`, `hemocue_count`, `blood_glucose`, `referrals`, `chronic_referral`) VALUES
(1, 11, '10/12/2017', 'Dr Joan Chin', 'came with mother. c/o fever 5 days with  runny nose, no sorethroat . diarrhoea 2x today. nil vomit today.also c/o groin pain \r\no/e pt well, afebrile,not pale.pharynx injected.bilateral enlarged tonsils,no exudates lungs clear.\r\nabdo: soft nontender,no organomegaly, rif not tender.bothtesteslie and size normal.no hernias on coughing. left small 0.5 cm inguinal lymphadenopathy, no cellulitis\r\n', 'viral fever.with mild ge', 'Respiratory', '', '', '', '', 0),
(2, 13, '10/12/2017', 'Dr Lawrence Ng', '1. Headache x 1 mth. Due to heavy work. Felt like fainting but no lose consciousness.\r\nNausea no vomit. Occasional blur vision. No fever. \r\nHead hit the wall by herself at age 10. ', '1. Headache', 'Neurology', '', '', '', '', 0),
(3, 10, '10/12/2017', 'Dr Joan Chin', 'c/o cough x 1 week,  dry, with sorethroat. runny nose\r\nno vomiting, diarrhoea\r\nhas dizziness x1 month, worse on looking downwards and moving the head.with r ear tinnitus, no hearing issues. with vertigo\r\nno family h/o ptb. non smoker\r\n\r\no/e well,,notpale, not tachynoeic. lungs clear.pharynx clear,\r\ncranial nerves intact, no nystagmus, no dysmetria, no dysdiadochokinesis. rhomberg neg..tandem gait normal\r\n\r\n', 'urti, bppv', 'Respiratory', '', '', '', '', 0),
(4, 18, '10/12/2017', 'Dr Joan Chin', 'm11. came alone,.\r\nhad cough  1 month  five years ago, now no more cough, no medical complaints currently.', 'for dental rv.', 'Dental', '', '', '', '', 0),
(5, 12, '10/12/2017', 'Dr Regina Tan', 'Sputum-green  X2 weeks\r\ninitially started with R\'nose\r\n no fever, no cough\r\nR leg weakness X 1 year\r\np/h of hypertension and R sided weakness more than 2  years\r\n weakness improved but getting worse now\r\non hypertensive medication 1/1 om\r\nPower  arm R 4+/5 L5/5\r\n               Lower leg R4/5 L5/5\r\nlungs clear', 'Hypertension with old R hemiplegia  \r\nURTI with secondary infection\r\n', 'Neurology,Respiratory', '', '', '', 'refer  GP for F/U of Hypertension and stroke prophylaxis', 0),
(6, 14, '10/12/2017', 'Dr Benjamin Tang', 'HTN\r\n- highest was systolic 160\r\n- known for 1 year\r\nepigastric pain\r\n- 2x/month\r\n- prev Hx of perf? ulcer. had of ?ascitic tap then and surgery. feels like similar pain\r\n\r\nchest pain - wakes up at night SOB too\r\nsharp pain for 2 weeks\r\nno SOBOE\r\nno smoking. no hx of resp conditions\r\n\r\nPlaque on both dorsum of feet. itchy when exposed to water\r\ndry skin overlying', 'HTN controlled\r\ngastric pain\r\nChest pain- ?Asthma\r\nPsoriasis', 'Cardiovascular', '', '', '', '', 0),
(7, 21, '10/12/2017', 'Dr Penny Lo', 'flu and cough for a month\r\ncough usually at night and after food\r\nwhite phlegm\r\n\r\nafebrile, pharynx normal\r\nlungs are clear\r\n\r\n', 'prolonged urti', 'Respiratory', '', '', '', '', 0),
(8, 20, '10/12/2017', 'Dr Joan Chin', 'F85.came with  grand daughter\r\nc/o cough 1 year, dry cough,no phlegm\r\non and off fever 1 year\r\nno weight loss. non smoker.\r\nhad ptb 2 years ago and rx for 16 months. was seen by dr  and told ok .\r\nhaving back pain x 1months with radiating pain down whole of both legs. cough impulse neg.\r\nno urine,bowel incontinence, has hard stools\r\n', 'afebrile now, not pale, bilateral cataracts. lungs clear\r\n\r\nSLR  90/90\r\nable to walk\r\ndx: treated  ptb, still on follow up. \r\nback pain  SLR 90/90', 'Musculo-skeletal,Respiratory', '', '', '', '', 0),
(9, 27, '10/12/2017', 'Dr Lawrence Ng', 'Chestburn x 2 mth. Farmer. No vomiting. At night. Gastric reflux in the morning. Not related to meals. Only on waking up. 2 kg loss of weight over 3 mths - pt said due to overwork.  Able to swallow well. No problem with bowels. No constipation.  Fam hx of appendicitis in mother. No fam hx of cancers.', 'Gastritis', 'Gastrointestinal', '', '', '', '', 0),
(10, 24, '10/12/2017', 'Dr Benjamin Tang', 'Neck pain and proceeding headache and visual blurriness\r\n- 6 months. once every month\r\n- brought on by stress- a lot of stress about family and money. rents and has financial trouble.\r\n\r\nepigastric pain\r\n- 2x /month\r\n- poor appetite and drinking. feels hot inside\r\n- has red urine when she has the pain. now it is normal', 'migraine and gastritic pain- stress induced', 'Gastrointestinal,Psychology', '', '', '', '', 0),
(11, 22, '10/12/2017', 'Dr Anu Pandey', '1. Left ear discharge  x 3 days\r\n- noted whitish fluid discharge from the left ear\r\n- also has been having some cough and runny nose for the past 3 days \r\n- fever (tactile)\r\n- when parents noted left ear discharge inserted some ? stick to remove the fluid\r\n- no bleeding noted\r\n- discharge has been persistent\r\n\r\nNo foreign body insertion\r\nNo preceding trauma\r\n\r\nAppetite and activity levels normal\r\nPU, BO normal\r\n\r\nFather with a cold as well \r\n\r\nPhysical examination\r\nAlert, not toxic looking \r\nNot in respiratory distress \r\nMild nasal congestion\r\nThroat not injected\r\nHeart S1S2, no murmur\r\nLungs clear\r\nAbdomen soft, no organomegaly\r\n\r\nLeft ear - purulent discharge seen\r\nRight ear - no discharge ', '1. Left ear otitis externa - unable to rule out OM \r\n', 'ENT', '', '', '', '', 0),
(12, 28, '10/12/2017', 'Dr Regina Tan', 'Itchiness on the facial skin on and off  , \r\nAcne on face\r\n Oily skin with papules and post acne scarring on cheek', 'Acne\r\n\r\n(advised to go to pharmacy for acne wash)', '', '', '', '', '', 0),
(13, 29, '10/12/2017', 'Dr Benjamin Tang', 'foot swelling. \r\n- started 3 days ago. pain on palpation and standing. limits her standing\r\n- unknown injury\r\n\r\nback pain. once every month\r\nradiates to head or neck. none now\r\ndoes not come in the morning\r\n\r\nepigastric pain. once this month\r\n\r\n', '- likely foot injury from work\r\n- Migraine. no investigations for now\r\n- gastric pain', 'Gastrointestinal,Musculo-skeletal', '', '', '', '', 0),
(14, 30, '10/12/2017', 'Dr Regina Tan', 'Skin feels hot at night but no fever for 1 month, so wants cream to cool it down\r\n Skin looks Normal', 'hot weather', '', '', '', '', '', 0),
(15, 25, '10/12/2017', 'Dr Angeline Lim', '24 y/o, para 1 (4 year old), had abdominal pain 2 months ago, seen by doctor, told to have tumor via ultrasound. Given 1 month oral medication, seen by another doctor, told no tumor. Presently no abdominal pain or vaginal discharge. Regular menstrual cycle. \r\n\r\nExamination: no masses felt, patient appears well ', '', 'Gynaecology', '', '', '', '', 0),
(16, 40, '10/12/2017', 'Dr Regina Tan', 'Feels like fainting  when working hard -construction worker-does flooring\r\nespecially on getting up\r\n no LOW\r\nGC fair\r\nno anemia\r\n Pulse 88/min  Heart S1S2 lungs clear\r\nAbd N', 'Postural hypotension secondary to dehydration', '', '', '', '', '', 0);
